import React from "react";
import "./MyOrder.css";
import order_list from './orderList';
import {
  Card,
  CardBody,
  CardTitle,
  CardText,
  ListGroup,
  ListGroupItem
} from "reactstrap";

function MyOrder() {
  let order = order_list;
  return (
    <section className="col-md-4">
      <Card>
        <CardBody>
          <CardTitle className="font-weight-bold text-center">
            Food Menu
          </CardTitle><hr />
          <CardText>
            Ordered Items
          </CardText>
          <ListGroup>
            {
              order.map(item => (
                <ListGroupItem key={item.id}>{item.name}</ListGroupItem>
              ))
            }
          </ListGroup>
        </CardBody>
      </Card>
    </section>
  );
}

export default MyOrder;
